import{_ as r}from"./plugin-vue_export-helper-c27b6911.js";import{r as d,o as i,c as n,d as t,e,a as o,f as l}from"./app-1ed3f6c2.js";const c={},s=t("h1",{id:"delay-calibration-dataset",tabindex:"-1"},[t("a",{class:"header-anchor",href:"#delay-calibration-dataset","aria-hidden":"true"},"#"),e(" Delay calibration dataset")],-1),h=t("h2",{id:"download",tabindex:"-1"},[t("a",{class:"header-anchor",href:"#download","aria-hidden":"true"},"#"),e(" Download")],-1),m={href:"https://gitee.com/i-eda/i-bm/tree/master/Delay_Calibration_Dataset/demo",target:"_blank",rel:"noopener noreferrer"},p=l('<p><strong>Dataset Description</strong></p><ol><li>Generate timing reports using the internal open-source static timing analysis tool, iSTA;</li><li>Generate corresponding timing reports using commercial static timing analysis tool, Prime Time;</li><li>Extract feature data for each timing path from the iSTA report, including features related to the delay of impact units and interconnect delays;</li><li>Determine the delay value from the PT report corresponding to each path, considering it as the Ground Truth;</li><li>Save the feature data extracted from iSTA and the corresponding label value from PT for each path into a .txt file.</li></ol><p><strong>File descriptions</strong></p><ul><li>Each timing path&#39;s features and labels in the document start with &quot;features&quot; and end with the start of the next path&#39;s &quot;features&quot;;</li><li>Each timing path contains 15 features extracted from the iSTA report and 4 labels extracted from the PT report;</li><li>Each row of data in the file represents a feature for each pin in the timing path. For example, the first row contains the names of each pin in the path;</li><li>Below is an explanation of each feature:</li></ul><table><thead><tr><th>Feature</th><th>Description</th></tr></thead><tbody><tr><td>pin name</td><td>pin name</td></tr><tr><td>cell name</td><td>instance name + pin name</td></tr><tr><td>fanout</td><td>fanout of the interconnect</td></tr><tr><td>rise_fall</td><td>rise/fall</td></tr><tr><td>is_net</td><td>flag indicating whether it is a net</td></tr><tr><td>capacitance</td><td>load capacitance</td></tr><tr><td>slew</td><td>slew</td></tr><tr><td>incr_elmore</td><td>Elmore method increase delay</td></tr><tr><td>incr_d2m</td><td>D2M method increase delay</td></tr><tr><td>incr_ecm</td><td>ECM method increase delay</td></tr><tr><td>incr_d2mc</td><td>MD2M method increase delay</td></tr><tr><td>at_elmore</td><td>Elmore method arrival time delay</td></tr><tr><td>at_d2m</td><td>D2M method arrival time delay</td></tr><tr><td>at_ecm</td><td>ECM method arrival time delay</td></tr><tr><td>at_d2mc</td><td>MD2M method arrival time delay</td></tr><tr><td>cap_pt</td><td>load capacitance from PT report</td></tr><tr><td>slew_pt</td><td>slew from PT report</td></tr><tr><td>incr_pt</td><td>increase delay from PT report</td></tr><tr><td>at_pt</td><td>arrival time delay from PT report</td></tr></tbody></table><p>The features and labels described above can be used for feature engineering and determining which features are most effective.</p><h2 id="updates" tabindex="-1"><a class="header-anchor" href="#updates" aria-hidden="true">#</a> Updates</h2><h2 id="citation" tabindex="-1"><a class="header-anchor" href="#citation" aria-hidden="true">#</a> Citation</h2><h2 id="contact" tabindex="-1"><a class="header-anchor" href="#contact" aria-hidden="true">#</a> Contact</h2><p>Please feel free to send any questions or comments to <a href="mailto:ieda.oscc@gmail.com">ieda.oscc@gmail.com</a>.</p>',10);function f(u,_){const a=d("ExternalLinkIcon");return i(),n("div",null,[s,h,t("p",null,[t("a",m,[e("Delay calibration dataset"),o(a)])]),p])}const y=r(c,[["render",f],["__file","Delay_Calibration.html.vue"]]);export{y as default};
